(3, 'Follow the Wind, but watch your back', 'Yasuo', 4, 3, '<div class="author-notes">\r\n<div style="text-align: center;"><a><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/images/spells/14.png" alt="14.png" width="32" /></a>&nbsp;- Help Secure Kills mainly. The reduce healing effect is also good against enemies with sustain/life steal.</div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div style="text-align: center;"><a><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/images/spells/4.png" alt="4.png" width="32" /></a>&nbsp;- To escape tight situations and making flashy plays.</div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div style="text-align: center;"><a><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/images/spells/21.png" alt="21.png" width="32" /></a>&nbsp;- IF you are against a champion that has hard burst (<a href="http://www.lolking.net/champions/syndra"><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/shared/riot/images/champions/134_64.png" alt="134_64.png" width="32" /></a><a href="http://www.lolking.net/champions/leblanc"><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/shared/riot/images/champions/7_64.png" alt="7_64.png" width="32" /></a><a href="http://www.lolking.net/champions/annie"><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/shared/riot/images/champions/1_64.png" alt="1_64.png" width="32" /></a><a href="http://www.lolking.net/champions/brand"><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/shared/riot/images/champions/63_64.png" alt="63_64.png" width="32" /></a>&nbsp;etc.) and need additional defenses.</div>\r\n<div style="text-align: center;">&nbsp;</div>\r\n<div style="text-align: center;"><a><img style="vertical-align: middle;" src="http://lkimg.zamimg.com/images/spells/12.png" alt="12.png" width="32" /></a>&nbsp;- If you\'re playing top!</div>\r\n</div>', '<ul class="runes">\r\n<li><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/r_1_3.png" alt="Gran marca de da&ntilde;o de ataque" />9x &nbsp; +0,95 da&ntilde;o de ataque</li>\r\n<li>&nbsp;9x+0.93% critical chance Greater Mark of Critical Chance</li>\r\n<li><img src="http://lkimg.zamimg.com/images/v2/runes/icons/size50x50/5289.png" height="56" /> 9x\r\n<div>+1.34 magic resist Greater Glyph of Magic Resist</div>\r\n</li>\r\n<li><img src="http://lkimg.zamimg.com/images/v2/runes/icons/size50x50/5317.png" height="56" /> 9x+1 armor Greater Seal of Armor</li>\r\n<li><img src="http://lkimg.zamimg.com/images/v2/runes/icons/size50x50/5335.png" /> 3x\r\n<div>+2.25 attack damage Greater Quintessence of Attack Damage</div>\r\n</li>\r\n<li><img src="http://lkimg.zamimg.com/images/v2/runes/icons/size50x50/5341.png" /> 3x+1.86% critical chance Greater Quintessence of Critical Chance</li>\r\n</ul>', '', '', 2, 1, '6.11.1', '2016-06-05 21:33:04', '2016-06-06 08:48:30'),
(6, 'Maokai Top', 'Maokai', 2, 2, '<p><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerFlash.png" alt="Destello" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerTeleport.png" alt="Teleportar" />&nbsp;Siempre que vayamos a jugar top lane con&nbsp;<img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/champion/Maokai.png" alt="Maokai" />, hay que llevar estos hechizos si o si.</p>\r\n<p>El&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerFlash.png" alt="Destello" />&nbsp;basicamente es esencial para engage o escapar en situaciones de peligro.</p>\r\n<p>El&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerTeleport.png" alt="Teleportar" />&nbsp;es el hechizo que nos permitira ayudar a otras l&iacute;neas o volver a la nuestra de forma r&aacute;pida.</p>', '<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/bl_3_3.png" alt="Gran quintaesencia de poder de habilidad" />+4,95 poder de habilidad | x3</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/r_1_3.png" alt="Gran marca de penetraci&oacute;n m&aacute;gica" />+0,87 penetraci&oacute;n m&aacute;gica | x9</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/y_1_3.png" alt="Gran sello de armadura" />+1 armadura<span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">| x9</span></p>\r\n<p><span style="color: #828282; background-color: #ffffff;"><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/b_3_3.png" alt="Gran glifo de resistencia m&aacute;gica" />+1,34 resistencia m&aacute;gica</span><span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">| x9</span></p>', '<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/MaokaiTrunkLine.png" alt="Q" />&nbsp;Q: Maximizarla siempre, la que menos cd tiene, y la que m&aacute;s da&ntilde;o proporciona y en area.</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/MaokaiUnstableGrowth.png" alt="W" />&nbsp;W: Priorizar despu&eacute;s de mejorar la Q&nbsp;<img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/MaokaiTrunkLine.png" alt="Q" />.</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/MaokaiSapling2.png" alt="E" />&nbsp;E: &Uacute;ltima habilidad a mejorar, como mucho si tenemos mucha presi&oacute;n en l&iacute;nea, es posible necessitar mejorarla 2 veces, para farmear l&iacute;nea de una Q + E.</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/MaokaiDrain3.png" alt="R" />&nbsp;R: Ultimante imprescindible para recivir menos da&ntilde;o, y protejer al equipo en teamfights.</p>', '<p><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3009.png" alt="Botas de rapidez" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3068.png" alt="Capa de fuego solar" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3065.png" alt="Rostro espiritual" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3025.png" alt="Guantelete de hielo" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3143.png" alt="Presagio de Randuin" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3026.png" alt="&Aacute;ngel de la guarda" />&nbsp;Objetos estandard.</p>\r\n<p>Si tienen mucho AD :&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3047.png" alt="Tabi de ninja" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3110.png" alt="Coraz&oacute;n de hielo" /></p>\r\n<p>Si tienen mucho AP:&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3102.png" alt="Velo del hada de la muerte" />&nbsp;por un item de AD, como el&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3143.png" alt="Presagio de Randuin" /></p>', 1, 1, '6.11.1', '2016-06-06 08:13:45', '2016-06-06 08:48:28'),
(7, 'Janna Supp', 'Janna', 6, 2, '<p><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerFlash.png" alt="Destello" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerExhaust.png" alt="Extenuaci&oacute;n" />&nbsp;o&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerFlash.png" alt="Destello" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerDot.png" alt="Prender" />&nbsp;Con el ignite si se quiere jugar agresivo.</p>', '<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/8021.png" alt="Gran quintaesencia de vida helada" />+26 vida | x3</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/r_3_3.png" alt="Gran marca de vida" />+3,47 vida&nbsp;<span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">| x9</span></p>\r\n<p><span style="color: #828282; background-color: #ffffff;"><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/y_1_3.png" alt="Gran sello de armadura" />+1 armadura</span><span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">| x9</span></p>\r\n<p><span style="color: #828282; background-color: #ffffff;"><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/rune/b_3_3.png" alt="Gran glifo de resistencia m&aacute;gica" />+1,34 resistencia m&aacute;gica</span><span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">&nbsp;</span><span style="color: #828282; background-color: #ffffff;">| x9</span></p>', '<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/HowlingGale.png" alt="Q" />&nbsp;Q: Habilidad que nos vendra muy bien para cortar sus ataques, sobretodo si nos viene el jungla. (Segunda o tercera habilidad a maximizar, dependiendo de lo que queramos).</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SowTheWind.png" alt="W" />&nbsp;W: Para ralentizar el objetivo, &uacute;til tanto para seguir como escapar.</p>\r\n<p><span style="color: #828282; background-color: #ffffff;">(Segunda o tercera habilidad a maximizar, dependiendo de lo que queramos).</span></p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/EyeOfTheStorm.png" alt="E" />&nbsp;E: Habilidad principal a maximizar, ya que proporciona un escudo y da da&ntilde;o de ataque al que se le aplica.</p>\r\n<p><img style="width: 50px; height: 50px;" src="http://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/ReapTheWhirlwind.png" alt="R" />&nbsp;R: Ultimate que va muy bien para cortar a los enemigos (ya que los empuja) y cura a los aliados que estan dentro de el.</p>', '<p>Inicio:&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/2009.png" alt="Galleta de rejuvenecimiento" />&nbsp;x3&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3092.png" alt="Filo de la reina de hielo" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3340.png" alt="T&oacute;tem guardi&aacute;n (talism&aacute;n)" /></p>\r\n<p>Primeros minutos:&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/2049.png" alt="Piedra de visi&oacute;n" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3341.png" alt="Lente de gran alcance (talism&aacute;n)" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/2043.png" alt="Guardi&aacute;n de visi&oacute;n total" />&nbsp;Dependiendo si tienen mucho CC&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3111.png" alt="Botas de mercurio" />&nbsp;o tienen mucho da&ntilde;o de ataque&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3047.png" alt="Tabi de ninja" />&nbsp;(si tienen mucho da&ntilde;o de ataque y mucho CC, preferiblemente&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3047.png" alt="Tabi de ninja" />).</p>\r\n<p>Objetos finales:&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3111.png" alt="Botas de mercurio" />&nbsp;o&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3047.png" alt="Tabi de ninja" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/2301.png" alt="Ojo de los vigilantes" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3190.png" alt="Medall&oacute;n de los Solari de Hierro" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3102.png" alt="Velo del hada de la muerte" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3143.png" alt="Presagio de Randuin" />&nbsp;<img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3512.png" alt="Portal Zz\'Rot" /></p>', 2, 0, '6.11.1', '2016-06-06 08:36:16', '2016-06-06 08:48:27'),
(8, 'Yi tryhard', 'Maestro Yi', 1, 4, '<p><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerSmite.png" alt="Aplastar" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/spell/SummonerDot.png" alt="Prender" /></p>', '', '', '<p><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/1419.png" alt="Encantamiento: Navaja de sangre" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3053.png" alt="Calibrador de Sterak" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3139.png" alt="Cimitarra mercurial" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3153.png" alt="Hoja del rey arruinado" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3124.png" alt="Hoja de furia de Guinsoo" /><img style="width: 50px; height: 50px;" src="https://ddragon.leagueoflegends.com/cdn/6.11.1/img/item/3006.png" alt="Grebas de berserker" /></p>', 0, 1, '6.11.1', '2016-06-06 08:41:15', '2016-06-06 08:48:32'),
